import React from 'react';
import { Layout, Button, Modal } from 'antd';

state = { visible: false };

showModal = () => {
  this.setState({
    visible: true,
  });
};

handleOk = e => {
  console.log(e);
  this.setState({
    visible: false,
  });
};

handleCancel = e => {
  console.log(e);
  this.setState({
    visible: false,
  });
};

const Dashboard = () =>
  <>
  <Layout style={{ margin: 20, background: 'white' }}>
  <section style={{}}>
    <Button size="large" type="primary" href="/newtrade">Add trade link</Button>
    <Button type="primary" onClick={this.showModal}>
      Open Modal
    </Button>
  </section>
  </Layout>
  </>

export default Dashboard
